import { DateTime } from "luxon";
import React from "react";
import ICallHistory from "../alias/ICallHistory";

interface IChatListDates {
  call: ICallHistory;
}

const ChatListDates: React.FC<IChatListDates> = ({ call }) => {
  return (
    <div>
      {DateTime.fromISO(call.number).toLocaleString(DateTime.DATETIME_SHORT)}
    </div>
  );
};

export default ChatListDates;
